import React from "react";
import ReactDOM  from "react-dom";
import myfav,{favprog, myName , myNames} from './App';

ReactDOM.render(
  <>
   <ol>
    <li>{myfav}</li>
    <li>{favprog}</li>
    <li>{myNames()}</li>
    <li>{myName}</li>

   </ol>
  </>
  ,document.getElementById('root')
);
